import {useRouter} from 'next/router'
import OperatorTile from "../../components/operatorTileComponent/OperatorTile"


const data = [
    {id: "1", operatorName: "megafon"},
    {id: "2", operatorName: "mts"},
    {id: "3", operatorName: "beeline"}
]


const PaymentPage = () => {
    const router = useRouter();
    const { payOperatorID } = router.query;

    return (
        <div>
            <h1>
                {payOperatorID}
            </h1>
            <OperatorTile props={
                data[0]
            }/>
        </div>
    )
}

export default PaymentPage
